import React, { useState } from "react";
import Input from "./Input";

const AddQuestions = () => {

  const [questionId,setQuestionId] =useState("");
  const [questionDetail, setQuestionDetail] = useState("");
  const [optionA, setOptionA] = useState("");
  const [optionB, setOptionB] = useState("");
  const [optionC, setOptionC] = useState("");
  const [optionD, setOptionD] = useState("");
  const [optionE, setOptionE] = useState("");
 const [answer, setAnswer] = useState("");
 const [numAnswers, setNumAnswers] = useState("");
 const [questionType, setquestionType] = useState("");
 const [difficultyLevel, setDifficultyLevel] = useState("");
 const [answerValue, setAnswerValue] = useState("");
 const [topicId, setTopicId] = useState("");
 const [negativeMarkValue, setNegativeMarkValue] = useState("");
  const onSubmit=(e)=>{

  }
  return <div className="container-fluid">
    <div className="row">
    
    
    <form onSubmit={onSubmit}>
    <div className="col">
    <Input name="questionId" type={"text"} text={"Question Id"} state={questionId} setStateFun={setQuestionId}/>
      <Input name="questionDetail" type={"text"} text={"Question Detail"} state={questionDetail} setStateFun={setQuestionDetail}/>
      <Input name="optionA" type={"text"} text={"Option A"} state={optionA} setStateFun={setOptionA}/>
      <Input name="optionB" type={"text"} text={"Option B"} state={optionB} setStateFun={setOptionB}/>
      <Input name="optionC" type={"text"} text={"Option C"} state={optionC} setStateFun={setOptionC}/>
      <Input name="optionD" type={"text"} text={"Option D"} state={optionD} setStateFun={setOptionD}/>
      <Input name="optionE" type={"text"} text={"Option E"} state={optionE} setStateFun={setOptionE}/>
    </div>
    <div className="col">
    <Input name="answer" type={"text"} text={"Answer"} state={answer} setStateFun={setAnswer}/>
      <Input name="numAnswers" type={"text"} text={"Num Answers"} state={numAnswers} setStateFun={setNumAnswers}/>
      <Input name="questionType" type={"text"} text={"Question Type"} state={questionType} setStateFun={setquestionType}/>
      <Input name="difficultyLevel" type={"text"} text={"Difficulty Level"} state={difficultyLevel} setStateFun={setDifficultyLevel}/>
      <Input name="answerValue" type={"text"} text={"Answer Value"} state={answerValue} setStateFun={setAnswerValue}/>
      <Input name="topicId" type={"text"} text={"Topic Id"} state={topicId} setStateFun={setTopicId}/>
      <Input name="negativeMarkValue" type={"text"} text={"Negative Mark Value"} state={negativeMarkValue} setStateFun={setNegativeMarkValue}/>
    </div>
     
      <div className="d-grid gap-2 col-2 mx-auto mb-2 mb-2">
        <button className="btn btn-primary" type="submit">
          Submit
        </button>
      </div>
    </form>
    </div>
  </div>;
};

export default AddQuestions;

